import React, {Component} from 'react';
import './navbar.css';

class navbar extends Component{
   render(){
       return(
           <nav className="NavbarItems">
               <h1 className="nav"><img src={require("./logo.jpeg")}/>adya</h1>
           </nav>
       )
   }
}
export default navbar;
